tables.table_schema:
CREATE TABLE high_net_worth_clients (
    client_id INT PRIMARY KEY,
    client_name VARCHAR(50),
    assets DECIMAL,
    liabilities DECIMAL
);

CREATE TABLE assets (
   id INT PRIMARY KEY,
   client_id INT,
   asset_name VARCHAR(255),
   asset_value DECIMAL
);

CREATE TABLE liabilities (
   id INT PRIMARY KEY,
   client_id INT,
   liability_name VARCHAR(255),
   liability_value DECIMAL
);

CREATE TABLE income_expenses (
   id INT PRIMARY KEY,
   client_id INT,
   income DECIMAL,
   expenses DECIMAL
);

CREATE TABLE assets (
    asset_id SERIAL PRIMARY KEY,
    client_id INT,
    asset_type VARCHAR(50),
    asset_value DECIMAL(10, 2)
);

CREATE TABLE liabilities (
    liability_id SERIAL PRIMARY KEY,
    client_id INT,
    liability_type VARCHAR(50),
    liability_amount DECIMAL(10, 2)
);
